import React from "react";
import DeleteOutlineIcon from "@material-ui/icons/DeleteOutlineIcon";

const Note = () => {
    
  return (
    <>
      <div className="note">
        <h1> title</h1>
        <br />
        <p> this is the content</p>
        <DeleteOutlineIcon className="deleteIcon" />
      </div>
    </>
  );
};

export default Note;
